class FormAssemblyServiceTest extends TestCase {

	private function stubClient($mockHandler): FormAssemblyClientServiceInterface{
		$stub = $this->createMock(FormAssemblyClientServiceInterface::class);
		$handlerStack = HandlerStack::create($mockHandler);
		$client = new Client(['handler' => $handlerStack]);
		$stub->method('getClient')
		     ->willReturn($client);
		return $stub;
	}


	public function testSuccessfulFormResponses() {
		$form_assembly_service = new FormAssemblyService();
		$mock = new MockHandler([
			new Response(200, [], '{"id":"210187","username":"fa-assignment","account_type":"1","authentication_type":"0","email":"product@formassembly.com","first_name":"","middle_name":"","last_name":"","company":"","address":null,"public_contact_info":null,"private_contact_info":"","time_zone":"America\/Indiana\/Indianapolis","locale":"en-US","must_reset_password":"0","use_ssl":"1","verified":"1","2fa_id":false}')
		]);
		$response = $form_assembly_service->getUser( $this->stubClient($mock), '');
		$this->assertEquals($response->email, "product@formassembly.com");
		$this->assertEquals($response->username, "fa-assignment");
	}


