	public function testInvalidAccessToken() {
		$this->expectException(\App\Models\CustomException::class);
		$this->expectExceptionMessage("Authentication error with FormAssembly");
		$form_assembly_service = new FormAssemblyService();
		$mock = new MockHandler([
			new RequestException("", new \GuzzleHttp\Psr7\Request('GET','/'), new \GuzzleHttp\Psr7\Response(422,[]))
		]);
		$form_assembly_service->getFormResponses( $this->stubClient($mock), '', 1);
	}

	public function testConnectionException() {
		$this->expectException(\App\Models\CustomException::class);
		$this->expectExceptionMessage("There has been a networking error with FormAssembly");
